import React from 'react';
import { Link } from 'react-router-dom';
import './Sidenav.css'; // Make sure to create a CSS file

function Sidenav() {
  return (
    <div className='sidenav'>
      <ul className='sidenav-list'>
        <li>
          <Link to={'/tv'} className='sidenav-link'>TV</Link>
        </li>
        <li>
          <Link to={'/headphone'} className='sidenav-link'>Headphones</Link>
        </li>
        <li>
          <Link to={'/speakers'} className='sidenav-link'>Speakers</Link>
        </li>
      </ul>
    </div>
  );
}

export default Sidenav;
